import { Route, Routes } from "react-router-dom";
import Home from "../home";
import Books from "../books";

const UserPortal = () => {
    return ( 
        <div className="userPortal">
           <Routes>
            <Route element={<Home />} path="/"/>
            <Route element ={<Books />} path=""/>
           </Routes>
        </div>
     );
}
 
export default UserPortal;
